import Values from '../public/api/branch1.json'


const formatNumber = (number) => new Intl.NumberFormat("en", { minimumFractionDigits: 2 }).format(number);
class App extends Component {


  componentDidMount(){

    fetch(`${process.env.PUBLIC_URL}/api/branch1.json`)
.then((r) => r.json())
.then((data) =>{
console.log(data)
    }
)
  }
  render() {
  //  console.log(data1)
    return (
      <div className="product-list">
        <label>Search Products</label>
        <input type="text" />

        <table>
        <thead>
          <tr>
            <th>Product</th>
            <th>Revenue</th>
          </tr>
        </thead>
        <tbody>
        </tbody>
        <tfoot>
          <tr>
            <td>Total</td>
            <td></td>
          </tr>
        </tfoot>
      </table>
    </div>
  );
  }
}

export default App;
